document.recipeCookingMethod:
[
  {
    "heading": "Salmon with herbed scrambled eggs",
    "methods": [
      {
        "method": "Whisk eggs, chives and dill in a medium jug; season."
      },
      {
        "method": "Melt 20g of the butter in a medium non-stick frying pan over medium heat; add egg mixture. Cook, without stirring, for 1 minute or until egg starts to set, then use a wide spatula to gently scrape the set egg mixture along the base of the pan; cook until creamy and barely set. Remove pan from heat."
      },
      {
        "method": "Melt remaining butter in a small frying pan over high heat; cook capers, stirring, for 3 minutes or until crisp."
      },
      {
        "method": "Serve scrambled egg with toast and topped with salmon, capers and dill sprigs."
      }
    ]
  }
]
